import React from 'react';

const Skills = () => {
    const skillImages = [
        { src: process.env.PUBLIC_URL + "/images/python_18894.webp", alt: "Python logo" },
        { src: process.env.PUBLIC_URL + "/images/file_type_html_icon_130541.webp", alt: "HTML logo" },
        { src: process.env.PUBLIC_URL + "/images/github_original_wordmark_logo_icon_146506.webp", alt: "GitHub logo" },
        { src: process.env.PUBLIC_URL + "/images/java_original_wordmark_logo_icon_146459.webp", alt: "Java logo" },
        { src: process.env.PUBLIC_URL + "/images/c_icon_132529.webp", alt: "C logo" },
        { src: process.env.PUBLIC_URL + "/images/docker_original_wordmark_logo_icon_146557.webp", alt: "Docker logo" },
    ];
  
    return (
        <section id="skills" className="skills-section">
            <h2>Skills</h2>
            <div className="cells">
                {skillImages.map((skill, index) => (
                    <div key={index} className="cell">
                        <img 
                            src={skill.src} 
                            alt={skill.alt} 
                            style={{ 
                                maxWidth: '100px', 
                                maxHeight: '100px',
                                border: '2px solid red'  // Add visible border for debugging
                            }} 
                            onError={(e) => {
                                console.error('Image load error:', e.target.src);
                                e.target.style.display = 'none';
                            }}
                        />
                        <span>{skill.src}</span>  {/* Show actual path for debugging */}
                    </div>
                ))}
            </div>
        </section>
    );
};
  
export default Skills;
